import React from "react";
import "../../styles/HomePage/WhyChooseUs.css";
import whyChooseImage from "../../assets/HomePage/whychooseus.jpg"; // Put your nice image here

const WhyChooseUs = () => {
  return (
    <div className="whychooseus-section">
      <div className="whychooseus-container">
        <div className="whychooseus-image">
          <img src={whyChooseImage} alt="Why Choose Us" />
        </div>
        <div className="whychooseus-content">
          <h2>Why Choose Us</h2>
          <ul>
            <li>✅ Experienced and Certified Doctors</li>
            <li>✅ Advanced Medical Equipment</li>
            <li>✅ 24/7 Emergency Support</li>
            <li>✅ Affordable Pricing</li>
            <li>✅ Trusted by 10,000+ Patients</li>
            <li>✅ Personalized Patient Care</li>
          </ul>
        </div>
      </div>
    </div>
  );
};

export default WhyChooseUs;
